import React from 'react';

function Logo() {
    return (
        <img src={`${process.env.PUBLIC_URL}/final_logo.png`} alt="Logo" className="h-16 sm:h-24 md:h-32 lg:h-40 w-auto ml-4 sm:ml-6 md:ml-16 mt-4 sm:mt-6 md:mt-16" />
    );
}

export default Logo;
